import React from 'react';
import './home.css';
import { Link, Outlet} from 'react-router-dom';



export const Home = () => {
  return (
    <div>
        <div className='Loginpage'>
        <nav>
          .
          <li><Link to="/" className='link'>Login</Link></li>
          <li><Link to="ab" className='link'>About</Link></li>
        </nav>
        </div>
  <Outlet/>
    </div>
  )
}
export default Home;
